import { useParams } from "react-router-dom"
function JobDetails(props) {
    let some = useParams();
    let jobFound = props.jobs.find((item) => {
        if (some.cid === item.id ) {
            return true;
        }
    })
  return (
    <>
          <div>
            <h1>{jobFound.title}</h1>
            <h3>{item.id}</h3>
          </div>
        );
      })}
    </>
  );
}

export default JobDetails;
